import React, { useState } from 'react';
import './GestionUsuariosCard.css';
import { cambiarEstadoUsuario } from '../../../../services/GestionUsuariosService'; // Ajusta la ruta según sea necesario
import Switch from '@mui/material/Switch';

export const GestionUsuariosCard = ({ user, onClose }) => {
    const [estadoUsuario, setEstadoUsuario] = useState(user.estado_usuario);

    const handleEstadoChange = async (event) => {
        setEstadoUsuario(event.target.checked);
        
        console.log('Nuevo estado del Switch:', estadoUsuario);
        console.log('id_usuario:', user.id_usuario);

        try {
            const resultado = await cambiarEstadoUsuario(user.id_usuario, estadoUsuario);
            if (resultado) {
                console.log('Estado del usuario actualizado correctamente');
            } else {
                console.error('No se pudo actualizar el estado del usuario');
            }
        } catch (error) {
            console.error('Error al cambiar el estado del usuario:', error);
        }
    };

    return (
        <div className='modal-container'>
            <div className="card">
                <div className="card-header">
                    <span onClick={onClose}>X</span>
                </div>
                <div className="card-title">
                    <h1>Datos del Usuario</h1>
                </div>
                <div className='card-image'>
                    <img 
                        src={JSON.parse(localStorage.getItem('usuario')).profile_image || '../img/isotipo-arsheep.png'} 
                        alt={`Imagen de ${user.nombre_usuario}`} 
                    />
                </div>
                <div className="card-content">
                    <div className="card-row">
                    <div className="card-item">
                            <strong>ID USUARIO:</strong><span>{user.id_usuario}</span>
                        </div>
                        <div className="card-item">
                            <strong>NOMBRE DE USUARIO:</strong><span>{user.nombre_usuario}</span>
                        </div>
                    </div>
                    <div className="card-row">
                        <div className="card-item">
                            <strong>ID EMPLEADO:</strong><span>{user.id_empleado}</span>
                        </div>
                        <div className="card-item">
                            <strong>FUNCIÓN:</strong><span>{user.EMPLEADO.ROL.desc_rol}</span>
                        </div>
                    </div>
                    <div className="card-row">
                        <div className="card-item">
                            <strong>NOMBRE:</strong><span>{`${user.EMPLEADO.pnombre} ${user.EMPLEADO.apaterno} ${user.EMPLEADO.amaterno}`}</span>
                        </div>
                    </div>
                    <div className="card-row">
                        <div className="card-item">
                            <strong>TELÉFONO:</strong><span>{user.EMPLEADO.numero_contacto}</span>
                        </div>
                    </div>
                </div>
                <div className="card-footer">
                    <label>
                        <Switch
                            checked={estadoUsuario}
                            onChange={handleEstadoChange}
                            color="primary"
                        />
                        Activar Usuario
                    </label>
                </div>
            </div>
        </div>
    );
};
